<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        *{
            padding: 0;
            margin: 0;
            box-sizing: border-box;
        }

        body{
            isolation: isolate;
            width: 100vw;
            height: 100vh;
            background-color: #000;
            display: grid;
          
            grid-template-columns: repeat(320, 5px);
            grid-auto-rows: 5px;
            gap: 1px;
            overflow: hidden;
        }

        section{
            position: relative;
            z-index: 5;
            background-color: rgb(0, 0, 0);
            box-shadow: 0 0 0 0 none;
            transition: 20s all;
            transition-delay: -5s;
        }

     

        .red{
            --color: red;
        }

        .green{
            --color: green;
        }

        .yellow{
            --color: yellow;
        }

        .white{
            --color: white;
        }

        .purple{
            --color: purple;
        }



        section:hover{
            /* transition: 0s all; */
            background-color:var(--color);
            cursor: pointer;
            box-shadow: 0 0 0 .5rem var(--color), 
            -10px -10px 20px 20px var(--color),
            10px 10px 20px 20px var(--color);
            /* opacity: .1; */
            z-index: 1;
            border-radius: 50%;
            transform: scale(20) translate(-0.2rem,-0.2rem) rotate(50turn) skew(250deg);
        }

     
    </style>
</head>
